import logo from './logo.svg';
import './App.css';
import Header from './MyComponents/Header';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";
import frontpage from "./MyComponents/frontpage";



function App() {

  return (
    <Router>

        <Header />
        <Routes>
      <Route path='#'></Route><frontpage/>
      </Routes>
    </Router>
  );
}

export default App;
